__NUXT_JSONP__("/drugs/Yttrium_Y_90-Edotreotide", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"A radioconjugate consisting of the octreotide derivative edotreotide labeled with yttrium 90 (Y-90) with potential radiotherapeutic uses. Similar to octreotide, yttrium Y 90-edotreotide binds to somatostatin receptors (SSTRs), especially type 2 receptors, present on the cell membranes of many types of neuroendocrine tumor cells, delivering tissue-specific, beta-emitting nuclide Y-90-mediated cytotoxicity to SSTR-positive cells. Yttrium Y 90-edotreotide is produced by substituting tyrosine for phenylalanine at the 3 position of the somatostatin analogue octreotide and chelating the substituted octreotide to Y-90 via dodecanetetraacetic acid (DOTA).",fdaUniiCode:"ABF7OG3FA3",identifier:"C2601",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C129819","C2124"],synonyms:["90Y-DOTA-3-Tyr-Octreotide","EDOTREOTIDE YTTRIUM Y-90","OctreoTher","Onalta","Yttrium Y 90 -DOTATOC","Yttrium Y 90 SMT 487","Yttrium Y 90-DOTA-3-tyrosine-octreotide","Yttrium Y 90-DOTA-Tyr3-Octreotide",c,"yttrium Y 90 SMT 487","yttrium Y 90 edotreotide","yttrium Y 90-DOTA-tyr3-octreotide"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FYttrium_Y_90-Edotreotide",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Yttrium_Y_90-Edotreotide","Yttrium Y 90-Edotreotide","2021-10-30T13:37:52.553Z")));